class Solution:
    def isSubFolder(self, folder1: str, folder2: str) -> int:
        '''
        rtype int: 1 for folder1 > folder2, -1 for folder1 < folder2
        '''
        m, n = len(folder1), len(folder2)
        if m < n:
            if folder2.startswith(folder1) and folder2[m] == '/':
                return 1
        elif m > n:
            if folder1.startswith(folder2) and folder1[n] == '/':
                return -1
        return 0

    def removeSubfolders(self, folders: 'List[str]') -> 'List[str]':
        # folders.sort()
        res = []
        for folder in folders:
            i, t = 0, 0
            while i < len(res):
                d = self.isSubFolder(folder, res[i])
                if d == 1:
                    if t != 0:
                        res.pop(i)
                        continue
                    res[i] = folder
                    t = 1
                if d == -1:
                    t = -1
                    break
                i += 1
            if t == 0:
                res.append(folder)
        return res


